import './App.css';

import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';

import {BrowserRouter as Router,Route} from "react-router-dom"


const App =()=>(
  <Router>
    <div>
    <Header/>
    <Route path="/create" element={<AddTimeTable/>}/>
    </div>
  </Router>
)

























export default App;
